import React from 'react'
import MovieList from './MovieList'
import { useSelector } from 'react-redux';
import store from '../redux/store';
import popularMovie from '../utils/constant';
import usePopularMovies from './../hooks/usePopularMovies';

const MovieContainer = () => {
    const { movie } = useSelector(store => store.movie);

    return (
        <div className='bg-black'>
            <div className='-mt-52 relative z-10'>
                <MovieList title={"Popular Movies"} movies={movie.usePopularMovies} />
                <MovieList title={"Now Playing Movies"} movies={movie.popularMovie} />
                <MovieList title={"Top Rated Movies"} movies={movie.popularMovie} />
                <MovieList title={"Upcoming Movies"} movies={movie.popularMovie} />
            </div>
        </div>
    )
}

export default MovieContainer
